  const UpdateData = (page, internal_key, key, value) => {
    console.log("this is the page", page);
    console.log("this is the internal key", internal_key);
    console.log("this is the key", key);
    console.log("this is the value", value);
    return (resume[page].find((el) => el === internal_key)[key] = value);
  };

  if (page === "about" && !internal_key) {
    setResume({
      ...resume,
      [page]: {
        ...resume[page],
        [key]: value,
      },
    });
